  import React from 'react';
  import { mdx } from '@mdx-js/react';

  export const frontMatter = {
	id: 'index-browser',
	title: 'Visualize Redis database keys using RedisInsight Browser Tool',
	sidebar_label: 'Visualize Redis database keys',
	slug: '/explore/redisinsight/browser'
};
export const metadata = {
  "unversionedId": "explore/redisinsight/browser/index-browser",
  "id": "explore/redisinsight/browser/index-browser",
  "isDocsHomePage": false,
  "title": "Visualize Redis database keys using RedisInsight Browser Tool",
  "description": "RedisInsight is a 100% free Redis GUI that allows you to visualise, monitor, and optimize while developing your applications with Redis. It provides an intuitive and efficient GUI for Redis allowing developers like you to interact with your databases and manage your data.",
  "source": "@site/docs/explore/redisinsight/browser/index-browser.mdx",
  "slug": "/explore/redisinsight/browser",
  "permalink": "/explore/redisinsight/browser",
  "editUrl": "https://github.com/redis-developer/redis-developer/edit/master/docs/explore/redisinsight/browser/index-browser.mdx",
