  /* @jsxRuntime classic */
/* @jsx mdx */
import Tabs from '@theme/Tabs';
import TabItem from '@theme/TabItem';
import useBaseUrl from '@docusaurus/useBaseUrl';
import RedisCard from '@site/src/theme/RedisCard';
export const toc = [{
  value: 'Step 1: Create a Redis Database',
  id: 'step-1-create-a-redis-database',
  children: []
}, {
  value: 'Step 2: Download RedisInsight',
  id: 'step-2-download-redisinsight',
  children: []
}, {
  value: 'Step 3: Open &quot;Browser Tool&quot;',
  id: 'step-3-open-browser-tool',
  children: []
}, {
  value: 'Step 4: Importing keys',
  id: 'step-4-importing-keys',
  children: []
}, {
  value: 'Step 5: Cloning the repository',
  id: 'step-5-cloning-the-repository',
  children: []
}, {
  value: 'Step 6. Adding a new key',
  id: 'step-6-adding-a-new-key',
  children: []
}, {
  value: 'Step 7. Searching the hash key',
  id: 'step-7-searching-the-hash-key',
  children: []
}, {
  value: 'Step 8: Filter keys by Data Type',
  id: 'step-8-filter-keys-by-data-type',
  children: []
}, {
  value: 'Step 9: Setting up the Expiry value',
  id: 'step-9-setting-up-the-expiry-value',
  children: []
}, {
  value: 'Step 10: Using CLI',
  id: 'step-10-using-cli',
  children: []
}, {
  value: 'Further References',
  id: 'further-references',
  children: []
}];

const layoutProps = {
  toc
};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">


    <p>{`RedisInsight is a 100% free Redis GUI that allows you to visualise, monitor, and optimize while developing your applications with Redis. It provides an intuitive and efficient GUI for Redis allowing developers like you to interact with your databases and manage your data. `}</p>
    <p>{`RedisInsight Browser lets you explore keys in your redis server. You can add, edit and delete a key. You can even update the key expiry and copy the key name to be used in different places of the application.`}</p>
    <p>{`In order to understand the capabilities of the browser tool, let us take a simple example and demonstrate capabilities of each of browse tool options:`}</p>
    <h2 {...{
      "id": "step-1-create-a-redis-database"
    }}>{`Step 1: Create a Redis Database`}</h2>
    <p><a parentName="p" {...{
        "href": "https://developer.redislabs.com/create"
      }}>{`Follow this link `}</a>{`to create Redis database`}</p>
    <h2 {...{
      "id": "step-2-download-redisinsight"
    }}>{`Step 2: Download RedisInsight`}</h2>
    <p>{`To install RedisInsight on your local system, you need to first download the software from Redis Labs website.`}</p>
    <p><a parentName="p" {...{
        "href": "https://redislabs.com/redis-enterprise/redis-insight/#insight-form"
      }}>{`Click this link `}</a>{` to access a form that allows you to select the operating system of your choice.`}</p>
    <p><img alt={"My Image"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/redisinsightinstall.png").default} /></p>
    <p>{`Run the installer. After the web server starts, open http://YOUR_HOST_IP:8001 and add a Redis database connection.`}</p>
    <p>{`Select "Connect to a Redis database"
`}<img alt={"My Image"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/redisinsight4.png").default} /></p>
    <p>{`Enter the requested details, including Name, Host (endpoint), Port, and Password.  Then click “ADD REDIS DATABASE”.`}</p>
    <h2 {...{
      "id": "step-3-open-browser-tool"
    }}>{`Step 3: Open "Browser Tool"`}</h2>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image1.png").default} title="image_tooltip" /></p>
    <h2 {...{
      "id": "step-4-importing-keys"
    }}>{`Step 4: Importing keys`}</h2>
    <p>{`Let us import a user database( 6k keys). This dataset contains users stored as Redis Hash.`}</p>
    <h3 {...{
      "id": ""
    }}></h3>
    <p><strong parentName="p">{`Users`}</strong></p>
    <p>{`The user hashes contain the following fields:`}</p>
    <ul>
      <li parentName="ul"><inlineCode parentName="li">{`user:id`}</inlineCode>{` : The key of the hash.`}</li>
      <li parentName="ul"><inlineCode parentName="li">{`first_name`}</inlineCode>{` : First Name.`}</li>
      <li parentName="ul"><inlineCode parentName="li">{`last_name`}</inlineCode>{` : Last name.`}</li>
      <li parentName="ul"><inlineCode parentName="li">{`email`}</inlineCode>{` : email address.`}</li>
      <li parentName="ul"><inlineCode parentName="li">{`gender`}</inlineCode>{` : Gender (male/female).`}</li>
      <li parentName="ul"><inlineCode parentName="li">{`ip_address`}</inlineCode>{` : IP address.`}</li>
      <li parentName="ul"><inlineCode parentName="li">{`country`}</inlineCode>{` : Country Name.`}</li>
      <li parentName="ul"><inlineCode parentName="li">{`country_code`}</inlineCode>{` : Country Code.`}</li>
      <li parentName="ul"><inlineCode parentName="li">{`city`}</inlineCode>{` : City of the user.`}</li>
      <li parentName="ul"><inlineCode parentName="li">{`longitude`}</inlineCode>{` : Longitude of the user.`}</li>
      <li parentName="ul"><inlineCode parentName="li">{`latitude`}</inlineCode>{` : Latitude of the user.`}</li>
      <li parentName="ul"><inlineCode parentName="li">{`last_login`}</inlineCode>{` : EPOC time of the last login.`}</li>
    </ul>
    <h2 {...{
      "id": "step-5-cloning-the-repository"
    }}>{`Step 5: Cloning the repository`}</h2>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` git clone https://github.com/redis-developer/redis-datasets
 cd redis-datasets/user-database
`}</code></pre>
    <p>{`Importing the user database:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` redis-cli -h localhost -p 6379 < ./import_users.redis
`}</code></pre>
    <p>{`Refresh the keys database by clicking as shown below:`}</p>
    <p>{`Click on “Scan More” to scan all 6k keys`}</p>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image3.png").default} title="image_tooltip" /></p>
    <p>{`You can get a real-time view of the data in your Redis database as shown below:`}</p>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image4.png").default} title="image_tooltip" /></p>
    <p>{`Select any key in the key database and the results gets displayed in the right hand side that includes Fields and values.`}</p>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image5.png").default} title="image_tooltip" /></p>
    <h2 {...{
      "id": "step-6-adding-a-new-key"
    }}>{`Step 6. Adding a new key`}</h2>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image6.png").default} title="image_tooltip" /></p>
    <p>{`Enter key name, field and value.`}</p>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image7.png").default} title="image_tooltip" /></p>
    <h2 {...{
      "id": "step-7-searching-the-hash-key"
    }}>{`Step 7. Searching the hash key`}</h2>
    <p>{`You can search the key by “user:9999” and you will see the result.`}</p>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image8.png").default} title="image_tooltip" /></p>
    <p>{`Let us add fields for user:9999 as shown below:`}</p>
    <p>{`You can even search by adding “*” and typing the first few letters.`}</p>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image10.png").default} title="image_tooltip" /></p>
    <h2 {...{
      "id": "step-8-filter-keys-by-data-type"
    }}>{`Step 8: Filter keys by Data Type`}</h2>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image12.png").default} title="image_tooltip" /></p>
    <h2 {...{
      "id": "step-9-setting-up-the-expiry-value"
    }}>{`Step 9: Setting up the Expiry value`}</h2>
    <p>{`Let us set it to 2 seconds and you won’t be able to search for the same key as it gets expired.`}</p>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image13.png").default} title="image_tooltip" /></p>
    <h2 {...{
      "id": "step-10-using-cli"
    }}>{`Step 10: Using CLI`}</h2>
    <p>{`RedisInsight CLI lets you run commands against a redis server. You don’t need to remember the syntax - the integrated help shows you all the arguments and validates your command as you type.`}</p>
    <pre><code parentName="pre" {...{}}>{`> HMGET user:3333 first_name last_name city

1) "Myrlene"
2) "McGrane"
3) "Qinghu"
`}</code></pre>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image14.png").default} title="image_tooltip" /></p>
    <h2 {...{
      "id": "further-references"
    }}>{`Further References`}</h2>
    <ul>
      <li parentName="ul"><a parentName="li" {...{
          "href": "/explore/redisinsight/slowlog"
        }}>{`Slowlog Configuration using RedisInsight`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "/explore/redisinsight/browser"
        }}>{`Explore Redis keys using RedisInsight browser tool`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "/explore/redisinsight/memoryanalyzer"
        }}>{`Memory Analysis using RedisInsight`}</a></li>
    </ul>
    </MDXLayout>;
}

;
MDXContent.isMDXComponent = true;
